#!/usr/bin/env python3
A = {3, 14, 15, 9, 26, 5, 35, 9}
B = {60, 22, 14, 0, 9}
print("intersection:", A&B )
print('difference:', A-B)
print('union:', A|B )
print('symetrical difference:', A^B)
dna_set = set('')
print(dna_set)
dna = ''
nt_comp = {}
for d in dna_set:
  c = dna.count(d)
  nt_comp[d] = c
print(nt_comp)
GC_content = (int(nt_comp['G'])+int(nt_comp['C']))/len(dna)
print("GC content in dna is:", GC_content)
